const Navbar = () => {
    return ( 
        <div className="sidenavbar">
           <div className="nav-upper">
            <div className="nav-heading">
                <div className="nav-brand">
                    <img src="icons/logo.png"  alt="logo"/>
                    <h2>showkart</h2>
                </div>
            </div>
           </div>
        </div>
     );
}
 
export default Navbar;
